// Import images
import chickenSoup from '';
import garlicBread from '../Components/images/starters/garlic_bread.jpg';
import golGappay from '../Components/images/starters/gol_gappay.jpg';
import springRolls from '../Components/images/starters/spring_rolls.jpg';
import onionRings from '../Components/images/starters/onion_rings.jpg';
import plainFries from '../Components/images/starters/plain_fries.jpg';
import loadedFries from '../Components/images/starters/loaded_fries.jpg';
import tacos from '../Components/images/starters/tacos.jpg';
import sandwiches from '../Components/images/starters/sandwiches.jpg';

// Define the dishes array
const dishes = [
    { id: 1, name: "Chicken Soup", picture: chickenSoup },
    { id: 2, name: "Garlic Bread", picture: garlicBread },
    { id: 3, name: "Gol Gappay", picture: golGappay },
    { id: 4, name: "Spring Rolls", picture: springRolls },
    { id: 5, name: "Onion Rings", picture: onionRings },
    { id: 6, name: "Plain Fries", picture: plainFries },
    { id: 7, name: "Loaded Fries", picture: loadedFries },
    { id: 8, name: "Tacos", picture: tacos },
    { id: 9, name: "Sandwiches", picture: sandwiches }
];

// Export the dishes array
export default starters;
